import React from 'react';
import './homePage.css';

function searchBar({ value, onChange }) {
  return (
    <div className="search-bar-container">
      <input
        type="text"
        className="search-bar"
        placeholder="Search products..."
        value={value}
        onChange={onChange}
      />
    </div>
  );
}

export default searchBar;
